B.Mh=new A.bU('Search query consist of multiple clauses {select |from |where |limit |since |facets |sort}. It Looks like a SQL query.\nClauses order can be any order, parse engine able to parse them."from" clause must be presented in any query.\nIndex document fileds are case sensitive. "\nselect clause contains list of fields, you can also provide * to pull all the index fields in a document. {{baseUrl}}/api/getfields?indexName=nameofindex can help get the list of fields\n',null,B.z,null)
